import React from "react";
import "./Home.css";

export const Home = () => {
  return (
    <div className="home_">
      <h2>OM:</h2>
      <br></br>
      <p>
        Driven lagspelare med stort intresse för IT och ny teknik. Lång
        erfarenhet från ekonomistyrning och bra på att strukturera och
        effektivisera mitt arbete, även erfarenhet från inköp och projektarbete
        samt kund-, leverantörs- och myndighetskontakt. Gillar problemlösning,
        felsökning och automatisering inom data, IT och nätverk.
      </p>
    </div>
  );
};
